Quota_Attainment_1.query:
q1 = load "${App.Datasets.Opportunity_FOR_DEMO1.FullyQualifiedName}";
q1 = filter q1 by 'UniqueUserName' == "Isabel Bozzo";
q2 = load "${App.Datasets.Quota_FOR_DEMO1.FullyQualifiedName}";
q2 = filter q2 by 'UniqueUserName' ==  "Isabel Bozzo";q2 = filter q2 by date('StartDate_Year', 'StartDate_Month', 'StartDate_Day') in ["current fiscal_quarter".."current fiscal_quarter"];
q1 = filter q1 by date('CloseDate_Year', 'CloseDate_Month', 'CloseDate_Day') in ["current fiscal_quarter".."current fiscal_quarter"];
q1 = filter q1 by 'Closed' == "TRUE";
q1 = filter q1 by 'Won' == "TRUE";
q = cogroup q1 by all left, q2 by all;
q = foreach q generate sum(q1.'Amount') as 'ClosedWonThisQuarter', sum(q2.'QuotaAmount') as 'QuotaAmountThisQuarter';
q = foreach q generate 'ClosedWonThisQuarter', 'QuotaAmountThisQuarter', round(coalesce(ClosedWonThisQuarter / QuotaAmountThisQuarter,0)*100,1) as 'Percent Quota Attainment', round(coalesce(ClosedWonThisQuarter / QuotaAmountThisQuarter,0),1) as 'PercentQuotaAttainmentThisQuarter';
q = limit q 2000;

Clone_of_Quote_KPIs_1.query:
q = load "${App.Datasets.Quote_FOR_DEMO1.FullyQualifiedName}";
q = filter q by 'Status' == "Presented";
q = foreach q generate 'Days_Presented' as 'Days_Presented', 'Quote_Name' as 'Quote_Name', 'Quote_Number' as 'Quote_Number', 'Effective_Quote_Total' as 'Effective_Quote_Total', 'Quote_Margin_Total' as 'Quote_Margin_Total';
q = order q by 'Days_Presented' desc;
q = limit q 100;

Clone_of___Accounts__2.query:
q = load "${App.Datasets.Orchestration_FOR_DEMO1.FullyQualifiedName}";
q = filter q by 'State' == "Fatally Failed";
q = filter q by 'UniqueUserName' == "Isabel Bozzo";
result = group q by ('Account_Name', 'Order_Number');
result = foreach result generate q.'Account_Name' as 'Account_Name', q.'Order_Number' as 'Order_Number', sum(q.'Effective_Order_Total') as 'Effective Order Total';
result = order result by ('Account_Name' asc, 'Order_Number' asc);
result = limit result 2000;

OpptyProduct_1.query:
q = load "${App.Datasets.Oppty_Products_FOR_DEMO1.FullyQualifiedName}";
q = filter q by 'Closed' == "FALSE";
q = group q by ('Product_ID', 'Product_Name', 'Account_ID');
q = foreach q generate 'Product_ID' as 'Product_ID', 'Product_Name' as 'Product_Name', 'Account_ID' as 'Account_ID', sum('Amount') as 'sum_Amount';
q = order q by 'sum_Amount' desc;
q = limit q 2000;

Header_1.query:
q = load "${App.Datasets.Opportunity_FOR_DEMO1.FullyQualifiedName}";
curr_qtr = filter q by date('CloseDate_Year', 'CloseDate_Month', 'CloseDate_Day') in ["current fiscal_quarter".."current fiscal_quarter"];
result = group q by all, curr_qtr by all;
result = foreach result generate date_to_string(now(),"yyyy-MM-dd") as 'todayy', first(curr_qtr['Fiscal_Quarter']) as 'Current Quarter', date_to_string(now(),"MMMMM") as 'month', case when starts_with(date_to_string(now(),"dd"),"0") then date_to_string(now(),"d") else date_to_string(now(),"dd") end as 'day', now() as 'today';
result = foreach result generate "Today: " + toString('today', "MMM dd, yyyy") + " | Q" +number_to_string('Current Quarter',"#")+" "+ number_to_string(daysBetween('today', quarter_last_day('today')),"##0") + " days left in quarter" as 'Date_and_Qtr_header', number_to_string(daysBetween('today', quarter_last_day('today')),"##0") as 'days_left_in_quarter', 'Current Quarter';
result = limit result 2000;
